package ch12.sec06;

public class ValueCompareExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Integer obj1 = 300;
		Integer obj2 = 300;
		
		System.out.println("==: " + (obj1 == obj2));
		System.out.println("equals(): " + obj1.equals(obj2));
		System.out.println();
	}

}
